import React, { Component } from "react";
import AppNavbar from "./appNavbar";
import { Tabs, Radio, Col, Row, Icon, Input } from "antd";

const { TabPane } = Tabs;
const { Search } = Input;

class SelfInfomation extends Component {
  state = {
    appNavbarWidth: "100%",
    appNavbarHeight: "10%",
    mode: "left",
    avatar_url:
      "https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png"
  };
  render() {
    const { appNavbarWidth, appNavbarHeight } = this.state;
    return (
      <div>
        <div
          style={{
            position: "fixed",
            zIndex: 1,
            width: "100%",
            background: "#f7f7f7"
          }}
        >
          <AppNavbar width={appNavbarWidth} height={appNavbarHeight} />
        </div>
        <div>
          <Row style={{}}>
            <Col span={6} offset={9}>
              <Tabs
                tabPosition={this.state.mode}
                defaultActiveKey="1"
                style={{ height: 400, width: 400, marginTop: 200 }}
              >
                <TabPane tab={"账号信息"} key={1}>
                  <Row>
                    <Col span={6}>
                      <Icon type="user" />
                      <span>昵称</span>
                    </Col>
                    <Col span={18}>
                      <Search />
                    </Col>
                  </Row>
                </TabPane>
              </Tabs>
            </Col>
          </Row>
        </div>
      </div>
    );
  }
}

export default SelfInfomation;
